var db=firebase.firestore();db.settings({timestampsInSnapshots:!0});var submitInfoRequest=(db,requestForm)=>{let name=requestForm.elements[0].value,email=requestForm.elements[1].value,subject=requestForm.elements[2].value,message=requestForm.elements[3].value;db.collection("webrequest").add({name:name,email:email,subject:subject,message:message}).then(function(docRef){console.log("Document written with ID: ",docRef.id),$("#contact-status").css("display","inline-block"),$("#contact-overlay").addClass("submitted-overlay"),$("#form-wrapper").css("color","chocolate"),$("#contact-fieldset").attr("disabled","true")}).catch(function(error){console.error("Error adding document: ",error)})};